import React from 'react'
import {Grid, makeStyles} from '@material-ui/core'
import HeaderBar from '..src/_components/_appBars/headerBar'

const styles = makeStyles({
    root:{
        display:'flex'
    },
    headerContainer:{
        display:'flex'
    },
    bodyContainer:{
        display:'flex'
    }
})

interface IProps{
    
}

const PageLayout: React.FC<IProps> = (props) => {

    const {children} = props

    const useStyle = styles();
    return(
        <Grid
            container
            className={useStyle.root}>
            <Grid
                container
                className={useStyle.headerContainer}>
                    <HeaderBar title='Test'/>
            </Grid>
            <Grid
                container
                className={useStyle.bodyContainer}>
                {children}
            </Grid>
        </Grid>
    )
}

export default PageLayout;
